import React from "react";
import Logo from "../../assets/img/logo.svg";
import { IonIcon } from "@ionic/react";
import { Icon } from '@iconify/react';
import {logoInstagram} from "ionicons";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="logo-col">
          <a href="#" class="footer-logo">
            <img class="logo" alt="Foodly logo" src={Logo} />
          </a>
          <ul class="social-links">
            <li>
              <a class="footer-link" href="#">
              <Icon class="social-icon" icon="ion:logo-instagram" />
              </a>
            </li>
            <li>
              <a class="footer-link" href="#">
              <Icon class="social-icon" icon="ion:logo-facebook" />
              </a>
            </li>
            <li>
              <a class="footer-link" href="#">
              <Icon class="social-icon" icon="ion:logo-twitter" />
              </a>
            </li>
          </ul>
        </div>
        <nav className="nav-col">

        </nav>
      </div>
    </footer>
  );
};

export default Footer;
